import React from "react";
import { faAddressBook, FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Login = () => {
  return (
    <div>
      <p>Login</p>
      <FontAwesomeIcon icon={faAddressBook} className=" fa-lg text-white " />
    </div>
  );
};

export default Login;
